// React
import React from "react";

// Third part
import { Row, Col, Table, Button } from "antd";
import { Content } from ".";

const { Column } = Table;

const Tables = ({ data, colOne, colTwo, colThird, colFourth, colFive }) => {
  return (
    <Table dataSource={data} rowKey={data => data.id}>
      <Column title={colOne} dataIndex="name" />
      <Column title={colTwo} dataIndex="price" />
      <Column title={colThird} dataIndex="type" />
      <Column title={colFourth} dataIndex="date" />
      <Column title={colFive} />
    </Table>
  );
};

export default Tables;

